import Link from 'next/link';

const Index = () => (
  <div>
    <Link href='/about'>
      <button>About Page</button>
    </Link>
    <Link href='/contact'>
      <a>Contact Us Page
      </a>
    </Link>
    <h1>Hellos</h1>
  </div>
);

export default Index;
